import React from 'react';
import { Link } from 'react-router-dom';

const Nav = ({onRouteChange, isSignedIn}) => {
		if(isSignedIn){
			return(
			<nav className='shadow-5' style={{display:'flex', justifyContent:'flex-start'}}>
			<Link to='/' className='f3 link dim black underline pa3 ma0 pointer'>Home</Link>
			<Link to='/profile' className='f3 link dim black underline pa3 ma0 pointer'>My Saved Events</Link>
			<Link to='/signout' style={{marginLeft: 'auto'}} className='f3 ma0 link dim black underline pa3 pointer'>Sign Out</Link>
			</nav>
			);	
		} else {
			return(
			<nav className='shadow-5' style={{display:'flex', justifyContent:'flex-start'}}>
			<Link to='/' className='f3 link dim black underline pa3 ma0 pointer'>Home</Link>
			<Link to='/signin' style={{marginLeft: 'auto'}} className='f3 ma0 link dim black underline pa3 pointer'>Sign In</Link>
			<Link to='/register' className='f3 link dim black underline pa3 ma0 pointer'>Register</Link>
			</nav>
			);
		}
}

export default Nav;
